import React from 'react';
import 
{ LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend} 
from 'recharts';
import 
{Radar, RadarChart, PolarGrid, PolarAngleAxis, PolarRadiusAxis,} 
from 'recharts';
import {
  BarChart, Bar, Cell
} from 'recharts';
import data_Courbes from './Story_Book_Data_Courbes'
import data_Arraignée from './StoryBookArraignéeData'
import data_Histo from './StoryBookHistoData'
import { FaFacebook} from 'react-icons/fa';
import { FiTwitter} from 'react-icons/fi';
import './Style.css';
import {GrInstagram} from 'react-icons/gr'
export default {
  title: 'Widgets',
};
export const Histo = () => (
      <BarChart
        width={550}
        height={300}
        data={data_Histo}
        margin={{
          top: 5, right: 30, left: 20, bottom: 5,
        }}
      >
        <CartesianGrid strokeDasharray="3 3" />
        <XAxis dataKey="name" />
        <YAxis />
        <Tooltip />
        <Legend />
        <Bar dataKey="pv" fill="#8884d8" />
        <Bar dataKey="uv" fill="#82ca9d" />
      </BarChart>
);
export const Nbre_de_pas = () => (
            <div className="Nbres_de_pas">
              <h1>Nombres de Pas</h1>
            </div>
);
export const widget3 = () => (
                <div className="Widget-3">
            <h3>Widget 3 : Total Views...</h3>
            </div>
);
export const widget4 = () => (
                  <div className="Widget-4">
                    <h3>Widget 4 : Followers per Network</h3>
                    <table>
                        <thead>
                        <tr>
                        <th><FaFacebook></FaFacebook>Number of Followers</th>
                        <th><GrInstagram></GrInstagram>Number of Followers</th>
                        <th><FiTwitter></FiTwitter>Number of Followers</th>
                        </tr>
                        </thead>
                    </table>
                  </div>
);
export const Courbes = () => (
<LineChart
    width={700}
    height={400}
  
    data={data_Courbes}
    margin={{ top: 5, right: 30, left: 20, bottom: 5,}}>
    <CartesianGrid strokeDasharray="3 3" />
    <XAxis dataKey="name" />
    <YAxis />
    <Tooltip />
    <Legend />
    <Line type="monotone" dataKey="pv" stroke="#8884d8" activeDot={{ r: 8 }} />
    <Line type="monotone" dataKey="uv" stroke="#82ca9d" />
</LineChart>
);
export const Arraignée = () => (
      <RadarChart cx={250} 
                  cy={190} 
                  outerRadius={150} 
                  width={500} 
                  height={390} 
                  data={data_Arraignée}
                  >
        <PolarGrid />
        <PolarAngleAxis dataKey="subject" />
        <PolarRadiusAxis />
        <Radar name="Mike" dataKey="A" stroke="#111111" fill="#8884d8" fillOpacity={0.7} />
      </RadarChart>
);
